import React, { Component } from 'react';
import { Redirect, Route, Switch } from 'react-router-dom';
import GenerateConstructorVariables from './GenerateConstructorVariables/GenerateConstructorVariables';
import GenerateConstructorVariables2 from './GenerateConstructorVariables2/GenerateConstructorVariables2';
import style from './Page.module.scss'
import {menu} from '../../data/menu';

export default class Page extends Component {
    renderRoute = () => {
       return menu.map((item, index) => {
            return item.sub.map((item2, index2) => {
                return (
                    <Route key = {index + '_'} path = {item2.url} component = {item2.component} />
                )
            })
        })
    }
    render() {
        return (
            <div className = {style.Page}>
                 <Switch>
                    <Route path = "/s/generate-constructor-variables" component = {GenerateConstructorVariables}/>
                    <Route path = "/s/generate-constructor-variables2" component = {GenerateConstructorVariables2}/>
                 </Switch>
            </div>
        )
    }
}
